jQuery.fn.logoHandler=function(options ){
	return $(this).each(function(){
		var $t = $(this),
			interval;

			$t.container = $t.find('.faces');

		$t.on('mouseenter', function(){
			showPath();
		}).on('mouseleave', function(){
			clearInterval(interval);
			$t.container.attr('data-item', 1);
		});

		function showPath(){
			var i = 0;
			interval = setInterval(function(){
				i++;
				if(i+1<$t.find('path').length){
					$t.container.attr('data-item', i+1);
				} else {
					$t.container.attr('data-item', 1);
					clearInterval(interval);
					showPath();
				}
			},100);

		}
	});
};

jQuery.fn.tilesSlider=function(options ){
	return $(this).each(function(){
		var $t = $(this);

		$t.items = $t.find('.js_item');
		$t.trigger = $t.find('.js_trigger');

		$t.trigger.on('click', function(e){
			if(e.target.tagName.toLowerCase() != 'a'){
				$t.items.slideUp(300);
				$t.trigger.slideDown(300);
				$(this).slideUp(300);
				$(this).next().slideDown(300);
			}
		});

		$t.items.on('click', function(e){
			if(e.target.tagName.toLowerCase() != 'a'){
				e.preventDefault();
				$t.items.slideUp(300);
				$(this).prev().slideDown(300);
			}
		});
	});
};
